    'checkers.dbPrefixResolveErrorDetailed' => "‫حدث خطأ أثناء تغيير بادئة جدول قاعدة البيانات الخاصة بعملية تثبيت برنامج WordPress '%%name%%': %%details%%‬",
    'checkers.disableFileEditingCheckError' => "‫حدث خطأ ما أثناء التحقق من حالة تعطيل تحرير الملف في لوحة معلومات برنامج WordPress على '%%name%%'.‬",
    'checkers.disableFileEditingCheckerHint' => '‫يؤدي تعطيل تحرير الملف في ووردبريس إلى محو القدرة على التحرير المباشر لمصادر المكون الإضافي وملف النسق في واجهة ووردبريس.‬ ‫يضيف هذا التدبير طبقة حماية إضافية لموقع ووردبريس في حالة تعرض أحد حسابات مسؤول ووردبريس للخطر.‬ ‫وبشكلٍ خاص، فإنه يمنع الحسابات المخترقة من إضافة التعليمات البرمجية الخبيثة القابلة للتنفيذ بسهولة إلى الإضافات أو النُسق.‬',
    'checkers.disableFileEditingCheckerTitle' => '‫تعطيل تحرير الملف في لوحة معلومات برنامج WordPress‬',
    'checkers.disableFileEditingCheckerUnresolvedMain' => '‫لم تقم %%number%% عمليات من عمليات تثبيت برنامج WordPress بتعطيل ميزة تحرير الملف في لوحة معلومات برنامج WordPress‬',
    'checkers.disableFileEditingResolveError' => "‫حدث خطأ ما أثناء تعطيل تحرير الملف في لوحة معلومات برنامج WordPress على '%%name%%'.‬",
    'checkers.disableScriptInCacheCheckError' => "‫حدث خطأ ما أثناء التحقق من حالة تعطيل تنفيذ PHP في أدلة ذاكرة التخزين المؤقت على '%%name%%'.‬",
    'checkers.disableScriptInCacheCheckerHint' => '‫إذا انتهى ملف PHP المخترق بأحد دلائل ذاكرة التخزين المؤقت لموقعك، فقد يؤدي تنفيذه إلى تعريض الموقع بأكمله للخطر.‬ ‫يؤدي هذا التدبير الأمني إلى تعطيل تنفيذ ملفات PHP في دلائل ذاكرة التخزين المؤقت، مما يحول دون وقوع مثل هذه الثغرات.‬ ‫لاحظ أن بعض الإضافات أو النُسق قد تتجاهل توصيات الأمان الصادرة من فريق أمن ووردبريس وتخزين الملفات التنفيذية الصالحة لـ PHP في دليل ذاكرة التخزين المؤقت.‬ ‫قد تضطر إلى تعطيل هذا التدبير الأمني إذا كنت بحاجة إلى تشغيل مثل هذه المكونات الإضافية أو النُسق.‬',
    'checkers.disableScriptInCacheCheckerTitle' => '‫تعطيل تنفيذ PHP في أدلة ذاكرة التخزين المؤقت‬',
    'checkers.disableScriptInCacheCheckerUnresolvedMain' => '‫لم تقم %%number%% عمليات من عمليات تثبيت برنامج WordPress بتعطيل تنفيذ PHP في أدلة ذاكرة التخزين المؤقت‬',
    'checkers.disableScriptInCacheResolveError' => "‫حدث خطأ ما أثناء تعطيل تنفيذ PHP في أدلة ذاكرة التخزين المؤقت على '%%name%%'.‬",
