    'checkers.disableUnusedScriptingCheckerTitle' => '‫تعطيل لغات البرمجة النصية غير المستخدمة‬',
    'checkers.disableUnusedScriptingCheckerUnresolvedMain' => '‫لم تقم %%number%% عمليات من عمليات تثبيت برنامج WordPress بتعطيل لغات البرمجة النصية غير المستخدمة‬',
    'checkers.disableUnusedScriptingResolveError' => "‫حدث خطأ ما أثناء تعطيل لغات البرمجة النصية غير المستخدمة على '%%name%%'.‬",
    'checkers.failedActivatePlugin' => '‫تم تغيير بادئة جدول قاعدة البيانات، ولكن لم يتم تنشيط بعض المكونات الإضافية.‬ ‫يتم تشغيل وضع الصيانة في برنامج WordPress الآن.‬ ‫قم بتنشيط المكونات الإضافية وإيقاف تشغيل وضع الصيانة.‬',
    'checkers.failedChangeConfig' => '‫لم يتم تغيير بادئة جدول قاعدة البيانات: يتعذر تعديل ملف التكوين.‬ ‫تم إلغاء تنشيط بعض المكونات الإضافية، ويتم تشغيل وضع الصيانة في برنامج WordPress الآن.‬ ‫تأكد من وجود أذونات قراءة وكتابة بملف wp-config.php، وقم بتنشيط المكونات الإضافية التي تم إلغاء تنشيطها، وأوقف تشغيل وضع الصيانة، ثم أعد محاولة إجراء العملية.‬',
    'checkers.failedChangeDb' => '‫لم يتم تغيير بادئة جدول قاعدة البيانات: حدث خطأ ما أثناء تغيير بنية قاعدة البيانات.‬ ‫تم التراجع عن جميع التغييرات.‬ ‫في حالة توقف عملية تثبيت برنامج WordPress، يرجى استعادة قاعدة البيانات من النسخة الاحتياطية ثم إعادة محاولة إجراء العملية.‬',
    'checkers.failedDeactivatePlugin' => '‫لم يتم تغيير بادئة جدول قاعدة البيانات: تعذر إلغاء تنشيط جميع المكونات الإضافية.‬ ‫لم يتم إلغاء تنشيط سوى بعض المكونات الإضافية، ويتم تشغيل وضع الصيانة في برنامج WordPress الآن.‬ ‫قم بتنشيط بعض المكونات الإضافية التي تم إلغاء تنشيطها وأوقف تشغيل وضع الصيانة وأعد محاولة إجراء العملية.‬',
    'checkers.failedTurnOffMaintenanceMode' => '‫تم تغيير بادئة جدول قاعدة البيانات، ولكن لم يتم إيقاف تشغيل وضع الصيانة في برنامج WordPress.‬ ‫أوقف تشغيل وضع الصيانة في برنامج WordPress يدويًا.‬',
    'checkers.failedTurnOnMaintenanceMode' => '‫لم يتم تغيير بادئة جدول قاعدة البيانات: تعذر تشغيل وضع الصيانة في برنامج WordPress.‬ ‫تأكد من احتواء مجلد wp_content على أذونات قراءة وكتابة ثم أعد محاولة إجراء العملية.‬',
    'checkers.noWordPressInstancesToSecure' => '‫لا يمكن تحسين تأمين مواقع ووردبريس المحددة.‬ ‫ارجع إلى قائمة جميع مواقع ووردبريس واختر المواقع الإلكترونية غير المؤمنة بالكامل حتى الآن.‬',
    'checkers.pingbacksCheckError' => "‫حدث خطأ ما أثناء التحقق من حالة التعليقات الآلية لتثبيت برنامج WordPress '%%name%%'.‬",
    'checkers.pingbacksCheckerHint' => 'تتيح طريقة الارتباط Pingbacks لمواقع ويب WordPress الأخرى ترك تعليقات تلقائيًا أسفل منشوراتك عندما ترتبط مواقع الويب هذه بهذه المنشورات. ويمكن إساءة استخدام طريقة الارتباط Pingbacks لاستخدام موقع الويب الخاص بك لهجمات DDoS على مواقع أخرى. ويعمل إجراء الأمن هذا على إيقاف تشغيل طريقة الارتباط pingbacks الخاصة بـ XML-RPC لموقع الويب بالكامل وتعطيل طريقة الارتباط pingback للمنشورات التي تم إنشاؤها مسبقًا كذلك مع تمكين pingbacks.',
    'checkers.pingbacksCheckerTitle' => '‫أوقف تشغيل التعليقات الآلية‬',
    'checkers.pingbacksCheckerUnresolvedMain' => '‫تم تمكين التعليقات الآلية في %%number%% عمليات تثبيت برنامج WordPress‬',
    'checkers.pingbacksResolveError' => "‫حدث خطأ ما أثناء تغيير حالة التعليقات الآلية لتثبيت برنامج WordPress '%%name%%'.‬",
    'checkers.scriptsConcatenationCheckError' => "‫حدث خطأ أثناء التحقق من حالة سلسلة البرامج النصية الخاصة بلوحة المسؤول ببرنامج WordPress على '%%name%%'.‬",
    'checkers.scriptsConcatenationCheckerHint' => "‫يعمل هذا الإجراء الأمني على إيقاف تشغيل سلسلة البرامج النصية التي يتم تشغيلها في لوحة المسؤول ببرنامج WordPress، مما يمنع تأثر موقع الويب الخاص بك بهجمات DoS (الحرمان من الخدمات) معينة.‬ ‫وقد يؤثر إيقاف تشغيل سلسلة البرامج النصية بشكل طفيف على أداء لوحة المسؤول ببرنامج WordPress، ولكن ينبغي ألا يؤثر ذلك على موقع ويب برنامج WordPress الخاص بك من منظور الزائرين.‬",
