    'checkers.secureConfigCheckerHint' => 'يحتوي ملف wp-config.php على معلومات حساسة مثل بيانات اعتماد الوصول إلى قاعدة البيانات وما إلى ذلك. ‫إذا تم إيقاف تشغيل معالجة ملفات PHP لسببٍ ما عن طريق خادم الويب، فقد يتمكن المتطفلون من الوصول إلى محتوى ملف wp-config.php.‬ يمنع إجراء الأمان هذا الوصول إلى ملف wp-config.php. يعمل هذا الإجراء على تعديل ملف تكوين الخادم (Apache، nginx لنظام التشغيل Linux أو web.config لنظام التشغيل Windows). ‫لاحظ أن التوجيهات المخصصة في ملفات .htaccess أو web.config قد تتجاوز ذلك‬.',
    'checkers.secureConfigCheckerHint.cpanel' => 'يحتوي ملف wp-config.php على معلومات حساسة مثل بيانات اعتماد الوصول إلى قاعدة البيانات وما إلى ذلك. ‫إذا تم إيقاف تشغيل معالجة ملفات PHP لسببٍ ما عن طريق خادم الويب، فقد يتمكن المتطفلون من الوصول إلى محتوى ملف wp-config.php.‬ يمنع إجراء الأمان هذا الوصول إلى ملف wp-config.php. يعمل هذا الإجراء على تعديل ملف تكوين الخادم (Apache، nginx). ‫لاحظ أن التوجيهات المخصصة في ملفات .htaccess قد تتجاوز ذلك‬.',
    'checkers.secureConfigCheckerTitle' => 'حظر الوصول إلى ملف wp-config.php',
