    'checkers.secureXmlRpcCheckerHint.cpanel' => 'يمنع إجراء الأمان هذا الوصول إلى ملف xmlrpc.php. يوصى بتطبيقه لتقليل مساحة الهجوم في حالة عدم استخدام XML-RPC. يعمل هذا الإجراء على تعديل ملف تكوين الخادم (Apache أو nginx). لاحظ أن التوجيهات المخصصة في ملفات .htaccess قد تتجاوز هذا.',
    'checkers.secureXmlRpcCheckerTitle' => 'حظر الوصول إلى ملف xmlrpc.php',
    'checkers.secureXmlRpcCheckerUnresolvedMain' => 'تم حظر الوصول إلى ملف xmlrpc.php على %%number%% عمليات تثبيت WordPress.',
    'checkers.secureContentCheckerHint' => 'قد يحتوي دليل wp-content/uploads على ملفات PHP غير آمنة يمكن تنفيذها للاستيلاء على موقع الويب الخاص بك واستغلاله. يمنع إجراء الأمان هذا ​​تنفيذ ملفات PHP في دليل wp-content/uploads. يعدّل هذا الإجراء ملف تكوين الخادم (Apache، وnginx لنظام التشغيل Linux أو web.config لنظام التشغيل Windows). ‫لاحظ أن التوجيهات المخصصة في الملفات htaccess. أو web.config قد تتجاوز ذلك.‬',
    'checkers.secureContentCheckerHint.cpanel' => 'قد يحتوي دليل wp-content/uploads على ملفات PHP غير آمنة يمكن تنفيذها للتحكم في موقعك على الويب واستغلاله. يمنع إجراء الأمان هذا تنفيذ ملفات PHP في دليل wp-content/uploads هذا. يعمل هذا الإجراء على تعديل ملف تكوين الخادم (Apache، nginx). ‫لاحظ أن التوجيهات المخصصة في ملفات .htaccess قد تتجاوز ذلك.‬',
