    'checkers.secureIndexingCheckerHint' => 'في حالة تشغيل "تصفح الدليل"، يمكن للمتسللين الحصول على معلومات مختلفة حول موقعك على الويب والتي يمكن أن تعرض أمانه للخطر. وعادةً ما يتم إيقاف تشغيل تصفح الدليل افتراضيًا، ولكن في حالة تشغيله، يمكن لإجراء الأمان ​​هذا حظره. يعدّل هذا الإجراء ملف تكوين الخادم (Apache، وnginx لنظام التشغيل Linux أو web.config لنظام التشغيل Windows). ‫لاحظ أن التوجيهات المخصصة في الملفات htaccess. أو web.config قد تتجاوز ذلك‬.',
    'checkers.secureIndexingCheckerHint.cpanel' => 'في حالة تشغيل "تصفح الدليل"، يمكن للمتسللين الحصول على معلومات مختلفة حول موقعك على الويب والتي يمكن أن تعرض أمانه للخطر. وفي حالة تشغيل تصفح الدليل، يمكن لإجراء الأمان ​​هذا حظره. يعدّل هذا الإجراء ملف تكوين الخادم (Apache، وnginx). ‫لاحظ أن التوجيهات المخصصة في الملف htaccess. قد تتجاوز ذلك‬.',
    'checkers.secureIndexingCheckerTitle' => 'منع تصفح الدليل',
    'checkers.secureIndexingCheckerUnresolvedMain' => 'يتم حظر تصفح الدليل على %%number%% عمليات تثبيت WordPress.',
