    'checkers.securityKeysCheckerHint' => "يستخدم WordPress مفاتيح الأمان (AUTH_KEY وSECURE_AUTH_KEY وLOGGED_IN_KEY و NONCE_KEY) لضمان تشفير أفضل للمعلومات المخزنة في ملفات تعريف ارتباط المستخدم. يجب أن يكون مفتاح الأمان الجيد طويلًا (60 حرفًا أو أكثر)، وعشوائيًا ومعقدًا. يجب أن يتحقق فحص التحقق من الأمان من إعداد مفاتيح الأمان وأنها تحتوي على أحرف أبجدية ورقمية على الأقل.",
    'checkers.securityKeysCheckerTitle' => 'تكوين مفاتيح الأمان',
