    'checkers.securityKeysResolveError' => "حدث خطأ أثناء تكوين مفاتيح الأمان على تثبيت WordPress '%%name%%'.",
    'checkers.securityPermissionsCheckError' => "‫حدث خطأ أثناء فحص الأذونات الخاصة بالملفات والدلائل في عملية تثبيت '%%WordPress '%%name‬",
    'checkers.securityPermissionsCheckerHint' => 'إذا كانت أذونات الوصول إلى الملفات والدلائل غير آمنة بما فيه الكفاية، فإنه يمكن للمتسللين الوصول إلى هذه الملفات واستخدامها للتغلب على موقع الويب الخاص بك. يقوم إجراء الأمان هذا بتعيين أذونات ملف wp-config إلى 600، والملفات الأخرى إلى 644، وللدلائل إلى 755.',
